import React , { useState, useEffect } from 'react';
import './OrderMng.css';
import OrderMngNav from './OrderMngNav.jsx';
import OrderMngTable from './OrderMngTable.jsx'
import CompletedOrders from './CompletedOrders.jsx'
import OrderHistory from './OrderHistory.jsx'
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown,Table} from 'react-bootstrap';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function OrderMng() {
		const [myData,setData] = useState([]);

		useEffect(()=>{

			fetch("dummy.json").then(function(resp){
				return resp.json();
			})
			.then(function(data){
				if(data != myData){
					setData(...myData,data)

				}
			})
			.catch(err => {
	          // Do something for an error here
	          console.log("Error Reading data " + err);
		})
		},[]);

		const renderTable = () => {
		    return myData.map(user => {
		      return (
		        <tr>
		          <td>{user.date}</td>
		          <td>{user.order_id}</td>
		          <td>{user.cust_id}</td>
		          <td>{user.address}</td>
		          <td>{user.delivery_items}</td>
		          <td>{user.qty}</td>
		          <td>{user.total}</td>
		          <td>{user.order_type}</td>
		          <td><span className="bg-green">Accept</span><span className="bg-red">Reject</span></td>
				  <td><span className="bg-gray">Preparing</span><span className="bg-light-silver">Done</span></td>
		        </tr>
		      )
		    })
		 }

		
		return(

			<Table responsive>
			  <thead>
			    <tr className="bg-light-silver">
			      <th>DATE</th>
			      <th>ORDER ID</th>
			      <th>CUST_ID</th>
			      <th>ADDRESS</th>
			      <th>DELIVERY ITEMS</th> 	
			      <th>QTY</th>
			      <th>TOTAL(PKR)</th>
			      <th>ORDER TYPE</th>
			      <th>ACTION</th>
			      <th>ORDER TRACKING</th>
			    </tr>

			  </thead>
			  <tbody>
			  	return myData.map(user=>{
			  		<OrderMngTable/>
			  	})
			  </tbody>
			</Table>
		)
		

}

